import jsPDF from "jspdf";
import "jspdf-autotable";
import moment from "moment";

// Date Fns is used to format the dates we receive
// from our API call


// define a generatePDF function that accepts a tickets argument
const generateHonorar = tickets => {

    const honorar = "202106KLRO"

    const gesamtBetrag = 0

    const NewDate = moment().format('MM.YYYY')
    // initialize jsPDF
    const doc = new jsPDF();

    // define the columns we want and their titles
    const tableColumn = ["Pos", "Anzahl h", "Honorar pro h", "Verg√ºtung"];
    // define an empty array of rows
    const tableRows = [
        ["1", "43.5", "54.6 EUR", "43.5 EUR"],
        ["2", "43.4", "43.5 EUR", "23.5 EUR"]
    ];

    var imgData = 'data:image/png;base64,'

    // startY is basically margin-top
    doc.autoTable({theme: "grid"})
    doc.autoTable(tableColumn, tableRows, { startY: 55, theme: 'grid'});
    let finalY = doc.lastAutoTable.finalY;
    // const date = Date().split(" ");
    // ticket title. and margin-top + margin-left
    doc.setFontSize(20)
    doc.setFont("Arial")
    doc.text("Honorarbescheinigung", 14, 15);

    doc.addImage(imgData, 'PNG', 165, 6, 30, 15)

    doc.setFontSize(14)
    doc.text(`F√ºr den Monat: ${NewDate}`, 14, 40)
    doc.line(30, 50, 180, 50)
    doc.line(30, finalY+5, 180, finalY+5)
    doc.setFontSize(12)
    doc.setFont("Arial", "bold")
    doc.text(`Gesamtbetrag:      ${gesamtBetrag}`, 150, finalY+15)
    // we define the name of our PDF file.
    doc.save(`${honorar}_Honorarbescheinigung.pdf`);
};

export default generateHonorar;